import Hero from "../components/Hero";
import Navbar from "../components/Navbar";
import AboutImg from "../assests/img5.jpg";
function Contact(){
    return(
        <>
        <Navbar />
        <Hero 
        cName="hero-mid"
        heroImg={AboutImg}
        ti/>

        <h1>This is about Contact</h1>
        </>
    )
}

export default Contact;
